import React from "react";
import {Input, Menu, Row, Col} from 'antd';
import Link from 'next/link';
import styled from "styled-components";

const StyledSearhBtn = styled.ant-btn-primary`
    background: 'black';
`

const AppLayout = ({children}) => {

    return(
        <div >
               <Menu mode='horizontal' style={{width: 1800, backgroundColor: 'black', color:'white'}}>    
               
                <Menu.Item >
                <Link href="/"><h1 style={{color:'white'}}>FASHIONARY</h1></Link>
                </Menu.Item>
                <Menu.Item>
                <Link href="/profile"><a style={{color:'white'}}>내 프로필</a></Link>
                </Menu.Item >
                <Menu.Item style={{background: 'black'}}>
                    <StyledSearhBtn />
                    <Input.Search 
                     enterButton
                    />
                </Menu.Item>
            </Menu>
            <Row gutter={8}>
                <Col xs={24} md={6}>
                    {/* {me ? <UserProfile /> : <Loginform />} */}
                </Col>
                <Col xs={24} md={12}>{children}</Col>
            </Row>
            
        </div>
    );

};

export default AppLayout;
